#include <ESP32Servo.h>

Servo myServo;


void setup() {
  int A = 4;
  int B = 5;
  int l;
  int L;
  l = RemoteXY.joystick_links_y;
  L = l / 100 * 255;
  if (l > 0) {
    L = L;
    digitalWrite(A, 0);
    analogWrite(B, L);
  } else if (l < 0) {
    L = -L;
    digitalWrite(B, 0);
    analogWrite(A, L);
  } else {
    L = 0;
    digitalWrite(A, 0);
    analogWrite(B, 0);
  }

  int C = 6;
  int D = 7;
  int r;
  int R;
  r = RemoteXY.joystick_rechts_y;
  R = r / 100 * 255;
  if (r > 0) {
    R = R;
    digitalWrite(C, 0);
    analogWrite(D, R);
  } else if (r < 0) {
    R = -R;
    digitalWrite(D, 0);
    analogWrite(C, R);
  } else {
    R = 0;
    digitalWrite(C, 0);
    analogWrite(D, 0);
  }

  RemoteXY_Init();

  myServo.attach(1);
  RemoteXY.servo = 0;

  // TODO your setup code
}




void loop() {
  RemoteXY_Handler();
  
  int ms = RemoteXY.servo * 20 + 500;
  myServo.writeMicroseconds(ms);
  
  drive();
}

